  true,\n\t\"url\": null,\n\t\"notes\": \"Low power, robust communications protocols
  such as IEEE 802.15.4/Zigbee have made the concept of smart sensor networks attractive
  across many applications. These systems promise portable, networked, wireless, sensor
  suites capable of monitoring and controlling environments as needed. Theseus Logic
  and MachineTalker will provide NASA with a rapidly deployable, wireless, intelligent,
  sensor system based on their proprietary enabling technologies, and their experience
  in wireless sensor systems for enhanced shipping container security.rn1.tCommunications
  based on MachineTalkers&lt;SUP&gt;REG&lt;/SUP&gt; that providing selfrn        configuring,
  self-healing ad hoc networks with minimumrn        intervention.rn2.tLow power radio
  protocols such as the IEEE 802.15.4/Zigbeern        standard. Gateways to reach
  a central monitoring/decisionrn        authority.rn3.tSecure communications with
  personal identification numbers (PIN)rn        assigned to each sensor node to ensure
  data security.rn4.tSignal processing based on clockless logic providing on demand,rn
  \       ultra low power, data driven, processing and low noise/EMI thatrn        maintains
  performance of sensors and on-chip RF/analog circuitry.rn5.tA Simple Machine Management
  Protocol&lt;SUP&gt;REG&lt;/SUP&gt; (SMMP&lt;SUP&gt;REG&lt;/SUP&gt;) controlling
  bothrn        sensors and communications. This also manages power consumptionrn
  \       of the system. rn6.tMulti-sensor data fusion to reduce false alarm rates.rn7.tA
  modular architecture allowing optimization of the sensor suite,rn        and including
  features such as GPS location, and biometricrn        identification. rn\",\n\t\"license_title\":
